import React from "react";
import {Form} from "react-bootstrap"

class Filter extends React.Component{
    constructor(props){
        super(props);
    }



    render(){
        return(
            <Form>
                <Form.Group>
                    <Form.Control as="select" multiple>
                        <option>1</option>
                        <option>2</option>
                        <option>3</option>
                        <option>4</option>
                        <option>5</option>
                    </Form.Control>
                </Form.Group>
            </Form>
        )
    }
}

export default Filter;
